Happy Saturday Loves! 💙✨

Here are the products (that absolutely no one asked for)😂used to create last weeks wedding glam…
Thank me later innit 😘💋

(For everyone DM’ing about the dress, it’s from @ratandboa & I’ve linked it for you in my stories xxx)

@narsissist radiance primer 
@armanibeauty luminous silk foundation in shade 8.75
@tartecosmetics creaseless concealer 
@narsissist Afterglow eyeshadow palette, I blended shades “shadow hill” & “crushed”
@esteelauder bronze goddess powder
@iconic.london illuminator high lighter 
@lancomeofficial Mon Sieur BIG waterproof mascara (this did not budge! Through sweat, tears & hours of dancing)
@hudabeauty Microshade brow pencil in “rich brown”
@maccosmetics “Cork” lip liner 
@urbandecaycosmetics cream lipstick, shade in “Depends on Traffic”
@diorbeauty Dior addict Lip glow oil 
@urbandecaycosmetics De-slick setting spray
